import React from "react";
import Navbar from "../components/Navbar";

const Home = () => {
	return (
		<div className="homeContainer">
			<Navbar />
			<div className="aboveHomeBanner">
				<h1 className="homeContainer">Timothy Jackreece</h1>
			</div>
			<div>
				<img alt="" src=""></img>
			</div>
			<div>
				<div id="1" className="homeCard">
					<div></div>
				</div>
				<div id="2" className="homeCard">
					<div></div>
				</div>
				<div id="3" className="homeCard">
					<div></div>
				</div>
			</div>
		</div>
	);
};

export default Home;
